import { React, useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import Card from "./components/Cards.jsx"
import styles from "./style/hand.module.css";

const App=()=> {
  const card1={
    key:"1",
    value:"3",
    type:"D"
  }
  const card2={
    key:"2",
    value:"J",
    type:"D"
  }
  const cardList=[]

  cardList.push(card1)
  cardList.push(card2)


  return (
    <div className={styles.handContainer}>
    <div className={styles.cardContainer}  >
      {cardList.map((card, index)=><Card 
      key={index}
      value={card.value}
      type={card.type}
      num={cardList.length}
     />)}

    </div>
    </div>
  );
}

export default App;
